/** @format */
import React from "react";

export default class Booklist extends React.Component {
  render() {
    return (
      <div>
        <table>
          <thead>
            <tr>
              <th>Title</th>
              <th>Author</th>
              <th>ISBN</th>
              <th>Read</th>
            </tr>
          </thead>
        </table>
      </div>
    );
  }
}
